function _M.methods:etag(key, mtime)
  if not self.base_path then
    return string.format('"%s"', md5.sumhexa(mtime .. key))
  else
    return string.format('"%s"', md5.sumhexa(mtime .. pathinfo_to_file(self, key)))
  end
end

